import React, { Component } from "react";

export default class ManualClock extends Component {
  constructor(props) {
    super(props);
    this.state = this.GetTime();
  }

  componentDidMount() {
    this.setTimer();
  }

  setTimer() {
    clearTimeout(this.setTimer);
  }

  updateClock() {
    this.setTimer;
  }

  GetTime() {
    const CurrentTime = new Date();
    return {
      hours: CurrentTime.getHours(),
      minutes: CurrentTime.getMinutes(),
      seconds: CurrentTime.getMinutes(),
      ampm: CurrentTime.getHours() >= 12 ? "pm" : "am",
    };
  }
  render() {
    const { hours, minutes, secodns, ampm } = this.state;
    return <div></div>;
  }
}
